b"Referencing NETStandard.Library version 1.6.1 in an app targeting .NET Core will result in updated implementations of various CoreFx libraries being published with the app.  These implementations will override the implementations that are part of the shared framework for .NET Core 1.0.  This means the app will lose some of the perf benefits (ie from ngen) and disk space benefits from using a shared framework.  As the updated implementations are from the FTS branch, this also pulls the app out of LTS.

So this PR changes the implicitly referenced version of NETStandard.Library back to 1.6.0.  This means that a .NET Core 1.0 app won't automatically fall out of LTS and lose other benefits of the shared framework simply by referencing a .NET Standard library.

@ericstj @weshaggard "

