b'https://github.com/NuGet/NuGet.Client/pull/1072, adde files under project entries in the assets file, such as the following, under `compile` and `runtime`:

```json
      "MainLibrary/1.0.0": {
        "type": "project",
        "framework": ".NETStandard,Version=v1.4",
        "dependencies": {
          "AuxLibrary": "1.0.0",
          "NETStandard.Library": "1.6.1"
        },
        "compile": {
          "bin/placeholder/netstandard1.4/MainLibrary.dll": {}
        },
        "runtime": {
          "bin/placeholder/netstandard1.4/MainLibrary.dll": {}
        }
      }
```

The `PublishAssembliesResolver` was trying to process the runtime files and getting a null reference because the package directory returned from the resolver was null.  I believe the right thing to do is to skip these projects entirely in `PublishAssembliesResolver.Resolve`, as the runtime and native assets from those projects should already have come in via the `ProjectReference` process.

@natidea @emgarten @eerhardt for review'

b"This will allow restore to succeed.  Fixes #448. Fixes #373 

Rather than generating an error (as specified in #448), this PR imports the common targets if the `LanguageTargets` property isn't set.  This means that restore can succeed even if the language targets aren't otherwise set, which means that F# or another language could be provided solely as a NuGet package instead of an MSBuild SDK.

@enricosada How does this look to you?  Once it is possible to have third party SDKs (see https://github.com/Microsoft/msbuild/issues/1493), you may still prefer to use an SDK for F# over a NuGet package.  It would make the project files more succinct and might avoid the project showing up differently in solution explorer when you create or open a project before the restore completes."

