b"The workaround to silence false invalid configuration warnings was effectively only half applied on Unix-based platforms. The issue is that a semicolon is treated by the shell as a command line separator so `dotnet msbuild /p:X=Y;Z=W` runs `dotnet msbuild /p:X=Y` then `Z=W`. The second command is valid and just sets the shell variable Z to W. 

:trollface: 

@dotnet/project-system for review

@piotrpMSFT @livarcocc FYI, this may lead to some support issues for folks passing semicolon-delimited msbuild properties to dotnet commands (if it hasn't already). There's nothing the CLI can do since the commands are separated by the shell. The user has to use multiple independent /p args or add quotes.
"

b"We don't use it so there's no need to repeat that line of logic from  Microsoft.Common.CurrentVersion.targets.

@eerhardt Just following up on something we spotted on our call. The common targets do not use ConfigurationName in IntermediateOutputPath either. That part is transcribed correctly using PlatformName and Configuration. As such, we don't actually need ConfigurationName to be set this early, so we can let Microsoft.Common.targets do it later and duplicate one less thing here.
"

